export class EventServiceMapOrder {
  constructor(id, date, dateFrom, dateUntil, costHour, rideCosts, total, totalHours, kilometre, billed, seen, approved, feeTransaction, event, serviceMap, cart) {
    this.id = id;
    this.date = date;
    this.dateFrom = dateFrom;
    this.dateUntil = dateUntil;
    this.costHour = costHour;
    this.rideCosts = rideCosts;
    this.total = total;
    this.totalHours = totalHours;
    this.kilometre = kilometre;
    this.billed = billed;
    this.seen = seen;
    this.approved = approved;
    this.feeTransaction = feeTransaction;
    this.event = event;
    this.serviceMap = serviceMap;
    this.cart = cart;
    this.billed = this.billed ?? false;
    this.seen = this.seen ?? false;
    this.approved = this.approved ?? false;
  }
}
export function getEventServiceMapOrderIdentifier(eventServiceMapOrder) {
  return eventServiceMapOrder.id;
}
